script: |
  super -f text -I q5365.spq | sort > q5365.out

inputs:
  - name: q5365.spq
    data: |
      SELECT DISTINCT - cor1.col0 * + tab1.col0 AS col1 FROM tab1 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0, tab1 (FORMAT parquet) AS cor1;
  - name: tab1

outputs:
  - name: q5365.out
    data: |
      -192
      -240
      -4096
      -5120
      -6400
      -9
